import React, { FC } from "react";

import "./style.css";

import ComponentProps from "./types";

const TodoItem: FC<ComponentProps> = ({ data }) => {
  return (
    <>
      <div className="round">
        <input type="checkbox" id={data} name={data} />
        <label htmlFor={data}></label>
      </div>
    </>
  );
};

export default TodoItem;
